import React from "react";
import data from './Components/data'
import Pkmninfos from './Pkmninfos'

class Pokedex extends React.Component{
    render () {
        return (
            <><h1>Pokedex</h1>
                {data.map((each) => <Pkmninfos key={each.id} name={each.name} image={each.image} type={each.type} value={each.averageWeight.value} measurementUnit={each.averageWeight.measurementUnit}  />)}
            </>
            )
    }
}

export default Pokedex
